  `birthday` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '生日',
  `role_id` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '角色id',
  `authority` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '用户权限',
