  `phone` varchar(255) COLLATE utf8_unicode_ci NOT NULL DEFAULT '' COMMENT '手机号码',
  `password` varchar(255) COLLATE utf8_unicode_ci NOT NULL COMMENT '密码',
  `avatar` varchar(255) COLLATE utf8_unicode_ci DEFAULT '/default_avatar.png' COMMENT '头像',
  `birthday` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '生日',
  `signature` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '签名',
  `level_id` mediumint(9) DEFAULT '0' COMMENT '会员等级id',
  `sheng_id` mediumint(9) DEFAULT '0' COMMENT '省id',
  `shi_id` mediumint(9) DEFAULT '0' COMMENT '市id',
  `qu_id` mediumint(9) DEFAULT '0' COMMENT '区县id',
  `status` smallint(6) DEFAULT '20' COMMENT '审核状态，10禁用，20启用',
  `sex` smallint(6) DEFAULT '10' COMMENT '性别，10男，11女，12保密',
  `remember_token` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL,
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  `auth_backstage` smallint(6) DEFAULT '10' COMMENT '是否是后台管理员10否，20是',
  `invite_code` varchar(100) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '邀请码',
  `com_id` int(11) DEFAULT NULL COMMENT '单位id',
  `office_id` int(11) DEFAULT NULL COMMENT '职务id',
