-- Table structure for `hh_wechat_info`
-- ----------------------------
DROP TABLE IF EXISTS `hh_wechat_info`;
CREATE TABLE `hh_wechat_info` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `user_id` int(11) NOT NULL DEFAULT '0' COMMENT '会员id',
  `title` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '标题',
  `keyword` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '关键词，匹配用户输入的信息',
  `pic` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '图片',
  `url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '点击图文消息跳转链接',
  `status` smallint(6) NOT NULL DEFAULT '20' COMMENT '状态，10禁用，20启用',
  `is_default` smallint(6) NOT NULL DEFAULT '10' COMMENT '是否为默认信息，10否，20是，当用户操作时，没有任何数据时调用默认信息',
  `type_info` smallint(6) NOT NULL DEFAULT '10' COMMENT '接收的消息类型，10文本消息，11图片消息，12语音消息，13视频消息，14小视频消息，15地理位置消息，16链接消息',
  `type_reply_info` smallint(6) NOT NULL DEFAULT '10' COMMENT '回复消息类型，10文本消息，11图片消息，12语音消息，13视频消息，14音乐消息，15图文消息',
  `type_event` smallint(6) NOT NULL DEFAULT '10' COMMENT '事件类型，20普通事件（即没有事件），10关注事件，11取消关注事件，12上报地理位置事件，13自定义菜单点击事件，14自定义菜单链接事件',
  `type_event_key` text COLLATE utf8_unicode_ci NOT NULL COMMENT '菜单事件值,当选择菜单事件时，该字段数据为必填项，存储的数据是菜单的key值',
  `order_by` mediumint(9) NOT NULL DEFAULT '0' COMMENT '排序',
  `content` text COLLATE utf8_unicode_ci COMMENT '内容',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

