  `pid` int(11) DEFAULT '0' COMMENT 'pid父级id',
  `name` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单名称',
  `type` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT '菜单事件类型，\n            click,view,scancode_push,scancode_waitmsg,pic_sysphoto,pic_photo_or_album,pic_weixin,location_select,media_id,view_limited',
  `key` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'click事件时有效',
  `url` varchar(255) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'view事件时有效',
  `status` smallint(6) NOT NULL DEFAULT '20' COMMENT '状态，10禁用，20启用',
  `order_by` smallint(6) NOT NULL DEFAULT '0' COMMENT '排序',
  `created_at` timestamp NULL DEFAULT NULL,
  `updated_at` timestamp NULL DEFAULT NULL,
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=2 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci;

