-family:隶书\">&nbsp;</span></strong></p><p style=\"text-align:center\"><strong><span style=\"font-size:56px;font-family:隶书\">任</span></strong></p><p style=\"text-align:center\"><strong><span style=\"font-size:19px;font-family:隶书\">&nbsp;</span></strong></p><p style=\"text-align:center\"><strong><span style=\"font-size:56px;font-family:隶书\">书</span></strong></p><p style=\"text-indent:193px\"><strong><span style=\"font-size:32px;font-family:仿宋_GB2312\">&nbsp;</span></strong></p><p style=\"text-indent:112px\"><strong><span style=\"font-size:19px;font-family:宋体\">&nbsp;</span></strong></p><p style=\"text-align:center;text-indent:112px\"><span style=\"font-size:19px;font-family:宋体\">&nbsp;</span></p><p style=\"text-align:center;text-indent:112px\"><span style=\"font-size:19px;font-family:宋体\">&nbsp;</span></p><p style=\"text-align:center;text-indent:112px\"><span style=\"font-size:19px;font-family:宋体\">&nbsp;</span></p><p style=\"text-align:center\"><strong><span style=\"font-size:20px;font-family:黑体\">责任单位：</span></strong></p><p style=\"text-align:center\"><strong><span style=\"text-decoration:underline;\"><span style=\"font-size:20px;font-family:宋体\">&nbsp;</span></span></strong></p><p style=\"text-align:center\"><span style=\"font-size:32px;font-family:隶书\">&nbsp;</span></p><p style=\"text-align:center\"><span style=\"font-size:32px;font-family:隶书\">&nbsp;</span></p><p style=\"text-align:center\"><span style=\"font-size:32px;font-family:隶书\">&nbsp;</span></p><p style=\"text-align:center\"><span style=\"font-size:32px;font-family:隶书\">中国港湾安全生产总方针</span></p><p style=\"text-align:center\"><span style=\"font-size:32px;font-family:隶书\">&nbsp;</span></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">坚持安全发展；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">遵守法规制度；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">落实主体责任；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">严格现场监控；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">消除事故隐患；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">保障健康安全；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">追求管理创新；</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family:黑体\">推动持续改进。</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family: 黑体\">&nbsp;</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:35px;line-height:150%;font-family: 黑体\">&nbsp;</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:21px;line-height:150%;font-family:仿宋\">职业健康安全环保职责</span></strong></p><p style=\"text-align:center;line-height:150%\"><strong><span style=\"font-size:21px;line-height: 150%;font-family:仿宋\">&nbsp;</span></strong></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">1</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、贯彻执行国家有关职业健康安全环保的法律法规，遵守中国交建和中国港湾各项职业健康安全环保规章制度，对项目部职业健康安全环保工作负总责；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">2</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、及时建立项目职业健康安全环保管理体系，检查实际运行情况；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">3</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、制订项目职业健康安全环保管理制度，分解落实职业健康安全环保岗位责任制，与分包单位签订职业健康安全环保责任书；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">4</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、编制施工组织设计和危险性较大分部分项工程安全专项施工方案并按规定组织报审和专家评审工作；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">5</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、组织危险源识别、评价，制订重大危险源预防监控措施；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">6</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、编制《职业健康安全环保预警及应急救援预案》或现场处置方案，并定期组织演练；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">7</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、独立设置安全监管部门，足额配备符合条件的专（兼）职安全管理人员；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">8</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、按照有关规定计提、使用、划拨、监管安全生产费用；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">9</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、严格过程监管，每月开展检查工作，消除各类隐患，落实带班制度；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">10</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、按规定开展职业健康安全环保教育培训，项目经理、安全管理人员、特种作业人员等必须按规定持有效证件上岗；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">11</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、及时、如实报告事故；</span></p><p style=\"text-indent:28px;line-height:150%\"><span style=\"font-size:20px;line-height:150%;font-family: 仿宋\">12</span><span style=\"font-size:20px;line-height:150%;font-family:仿宋\">、接受中国港湾的职业健康安全环保考核。</span></p><p>&nbsp;</p><table><tbody><tr class=\"firstRow\"><td width=\"748\" valign=\"top\" style=\"word-break: break-all;\"><strong><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;职业健康安全环保管理目标</span></strong></td></tr><tr><td width=\"748\" valign=\"top\" style=\"word-break: break-all;\"><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化法规意识，严格责任考核；强化体系建设，确保有效运行；&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化培训教育，提高防范技能；强化安全管控，保障顺利履约；&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化隐患治理，防范各类事故；强化事故报告，严禁瞒报谎报；&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化应急管理，确保预案有效；强化环境保护，严防污染事件；&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化危害防治，保障职业健康；强化分包管理，落实总包职责；&nbsp;&nbsp;&nbsp;&nbsp;</span></p><p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; 强化安全文化，发挥全员作用。</span></p></td></tr><tr><td width=\"748\" valign=\"top\" style=\"word-break: break-all;\"><strong><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;职业健康安全环保控制指标</span></strong></td></tr><tr><td width=\"748\" valign=\"top\" style=\"word-break: break-all;\"><p style=\"text-indent:19px\"><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;（一）杜绝发生一般及以上生产安全责任事故。</span></p><p style=\"text-indent:19px\"><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;（二）杜绝发生较大及以上水上交通责任事故。</span></p><p style=\"text-indent:19px\"><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;（三）杜绝发生负有建设管理责任的较大及以上生产安全责任事故。</span></p><p style=\"text-indent:19px\"><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;（四）杜绝发生一般及以上突发环境责任事件。</span></p><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; （五）杜绝发生重大及以上职业病危害责任事故。</span></td></tr></tbody></table><table><tbody><tr class=\"firstRow\"><td width=\"363\" valign=\"top\" style=\"word-break: break-all;\"><span style=\"font-size:19px;font-family:黑体\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp;责任单位负责人签字</span></td><td width=\"363\" valign=\"top\" style=\"word-break: break-all;\"><span style=\"font-size:19px;font-family:黑体\">&nbsp; &nbsp; &nbsp; &nbsp;公司责任部门总经理签字</span></td></tr><tr><td width=\"363\" valign=\"top\" style=\"word-break: break-all;\"><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp;</p><p>&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp;&nbsp;{data_2}</p><p>&nbsp;</p><span style=\"font-size:14px;font-family: &#39;Times New Roman&#39;,&#39;serif&#39;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; </span><span style=\"font-size:19px;font-family:仿宋_GB2312\">&nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; &nbsp; <span style=\"font-family: 仿宋_GB2312; font-size: 16px;\">日期:<